import React from 'react'
import {Container, Nav, NavBar, NavbarBrand, NavbarCollapse, Button} from 'react-bootstrap'
import logo from ' '
import { useHistory } from 'react-router-dom';

const NewPage = () => {

	const handleLogOut = () => {

    history.push('/Form.jsx');
  };

	return (
	<NavBar bg = 'dark' variant = 'dark'>
		<Container>
			<NavbarBrand href = './NewPage'>
				<img src = {logo} 
				height = '30'
				width= '30'
				className='d-inline-block align-top'
				alt='logo' />
			</NavbarBrand>
			<NavbarCollapse id='responsive-navbar-nav'>
				<Nav className='mr-auto'>
					<Nav.Link href = '/'>
						Home
					</Nav.Link>
				</Nav>

					<Button variant = "danger" onClick = {handleLogOut}>
						Log Out
					</Button>
					
			</NavbarCollapse>
		</Container>
	</NavBar>
	)

};

export default NewPage;
